import './ExpenseItem.css'
function ExpenseItem() {
    return (
        <div className="expense-item">
            <div>Jan 7th 2023</div>
            <div className="expense-item__">
                <h2> Car Insurance</h2>
                <div className="expense-item__price">$156.78</div>
            </div>
        </div>
    )
    }
export default ExpenseItem;
